elf) -> Option<T> { match self.is_empty() { true => None, false => { let t = self.elements.swap_remove(0); self.heapify_down(); Some(t) } } } pub fn is_empty(&self) -> bool { self.elements.len() == 0 } pub fn top(&self) -> Option<&T> { match self.is_empty() { true => None, false => self.elements.get(0), } } //Start at the top index element. If it is bigger than either of its children //we are done. Otherwise, bring top element down. Continue down. fn heapify_down(&mut self) { let mut index = 0; while self.has_left_child(index) { let mut bigger_child_index = Self::left_child_index(index); if self.has_right_child(index) && self.right_child(index) > self.left_child(index) { bigger_child_index = Self::right_child_index(index); } if self.elements[index] > self.elements[bigger_child_index] { break; } else { self.elements.swap(index, bigger_child_index); } index = bigger_child_index; } }
