pub fn permutate(s: &str) -> Vec<String> { let mut result = Vec::new(); if s.len() == 0 { return result; } if s.len() == 1 { result.push(s.to_string()); return result; } let chars: Vec<_> = s.chars().collect(); for i in 0..chars.len() { let ch = chars[i]; let mut segment = String::from(&s[0..i]); segment += &s[i + 1..]; let intermediates = permutate(&segment); for mut s in intermediates { s.push(ch); result.push(s); } } result
